function PropComponent (props) {
    console.log(props);
    console.log(props.title);
    console.log(props.itemObject);
    const containerStyle = {
        backgroundColor: "white",
        borderRadius: "10px",
        padding: "20px",
        color: "black"
    }
    return (
        <div style={containerStyle}>
            <h4>{props.title}</h4>
            <p>{props.subtitle}</p>
            <p>{props.username}</p>
        </div>
    )
}

export {PropComponent};
